import React from 'react'
import { Navigate, RouteProps } from 'react-router-dom';

export const PrivateRoute = ({children}: RouteProps) => {

    let user = localStorage.user;

  return (
    <>
        {
            user
            ?
            children
            :
            <Navigate to="/dang-nhap" />
        }
    </>
  )
}
